/*--担当车收入---*/
IF EXISTS (SELECT * FROM sysobjects WHERE type = 'U' AND name = 'newtrainshourou')
	BEGIN
		DROP  Table newtrainshourou
	END
GO

CREATE TABLE newtrainshourou
(
   
  num           integer not null primary key,				--序号
  byear         integer not null,							--年份
  bmonth        integer not null,							--月份
  trainname     varchar(50) not null,						--车次
  astation      varchar(50) not null,						--始发站
  bstation      varchar(50) not null,						--终到站
  shourou1      numeric(18,2),								--旅客列车全程客票进款
  shourou2      numeric(18,2),								--旅客票价进款
  shourou3      numeric(18,2),								--软票费
  shourou4      numeric(18,2),								--卧订费
  shourou5      numeric(18,2),								--空调费
  shourou6      numeric(18,2),								--应收客票进款
  yinzuo        integer,									--编组（硬座）
  ruanzuo       integer,									--编组（软座）
  openyinwo     integer,									--编组（硬卧）
  closeyinwo    integer,									--编组（封闭式硬卧）
  ruanwo        integer,									--编组（软卧）
  advanceruanwo integer,									--编组（高级软卧）
  canche        integer,									--编组（餐车）
  fadianche     integer,									--编组（发电车）
  shuyinche     integer,									--编组（行李车）
  youzhengche   integer										--编组（邮政车）

)
GO

